    true,nt"url": null,nt"notes": "Secondary School Arts and Education Survey,
    2009 (FRSS 101), is a study that is part of the Quick Response Information System.
    FRSS 101 (http://nces.ed.gov/surveys/frss/) is a sample survey that provides national
    estimates on student access to arts education and the resources available for such
    instruction in public secondary schools during fall 2009. The study was conducted
    using mailed questionnaires that could be completed via mail or the web. Follow-up
    telephone interviews were also conducted. School principals were sampled. The study's
    response rate was 87 percent. Key statistics produced from FRSS 101 are availability
    of music, visual arts, dance, and drama/theatre instruction; enrollment in these
    courses, the type of space used for arts instruction, the availability of curriculum
    guides for arts teachers to follow, and the number of arts teachers who are specialists
    in the subject.",nt"license_title": "Creative Commons CCZero",nt"extras":
